import React from 'react';
import { Link } from 'react-router-dom';
import './Nav.css';

const Nav = () => {
  return (
    <nav id="nav">
      <ul>
        <li>
          <Link to="/" className="AmitSahoo45-button-1">
            <span>Home</span>

          </Link>
        </li>
        <li>
          <button to="/portfolio" className="raulwwq0-button-1">
            <span>Portfolio</span>

          </button>
        </li>
        <li>
          <Link to="/contact" className="raulwwq0-button-1">
            <span>Contact</span>

          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Nav;
